import React from 'react';
import Footer from '../Components/Footer';
import './css.css';

function PageAcceuil() {

  return (
      <div className="container">


         {/* 1. Logo au centre de la page */}
         <div style={{ textAlign: 'center' }}>
            <img src="/LogoGoblo.png" alt="Logo" />
         </div>

         {/* 2. Div principale avec 6 boutons */}
         <div className="main-container">
            {/* Bouton 1 */}
            <button className="sub-button">
               {/* Ic么ne dans un cercle */}
               <div className="circle-icon">
                  <img src="/Enroler.png" alt="Enroler" />
               </div>
               {/* Titre */}
               <h2>Enr么ller</h2>
               {/* Texte en dessous du titre */}
               <p>Enregistrer les contribuables</p>
            </button>

            <button className="sub-button">
               {/* Ic么ne dans un cercle */}
               <div className="circle-icon">
                  <img src="/Encaisser.png" alt="Encaisser" />
               </div>
               {/* Titre */}
               <h2>Encaisser</h2>
               {/* Texte en dessous du titre */}
               <p>Encaisser les contribuables</p>
            </button>

            <button className="sub-button">
               {/* Ic么ne dans un cercle */}
               <div className="circle-icon">
                  <img src="/Rapport.png" alt="Rapport" />
               </div>
               {/* Titre */}
               <h2>Rapport</h2>
               {/* Texte en dessous du titre */}
               <p>Consulter les rapports</p>
            </button>

            <button className="sub-button">
               {/* Ic么ne dans un cercle */}
               <div className="circle-icon">
                  <img src="/Compte.png" alt="Compte" />
               </div>
               {/* Titre */}
               <h2>Compte</h2>
               {/* Texte en dessous du titre */}
               <p>Cr茅er les comptes utilisateurs</p>
            </button>

            <button className="sub-button">
               {/* Ic么ne dans un cercle */}
               <div className="circle-icon">
                  <img src="/icone1 .png" alt="Icone 1" />
               </div>
               {/* Titre */}
               <h2>Titre 1</h2>
               {/* Texte en dessous du titre */}
               <p>Texte 1</p>
            </button>

            <button className="sub-button">
               {/* Ic么ne dans un cercle */}
               <div className="circle-icon">
                  <img src="/icone1.png" alt="Icone 1" />
               </div>
               {/* Titre */}
               <h2>Titre 1</h2>
               {/* Texte en dessous du titre */}
               <p>Texte 1</p>
            </button>

         </div>

         {/* 3. Footer */}
         <Footer />
      </div>
  );
}

export default PageAcceuil;
